import React from 'react';
import ContactForm from '../components/ContactForm';
import FounderProfile from '../components/FounderProfile';

function Contact() {
    return (
        <div className="py-20 bg-gray-200">
            <h1 className="text-3xl font-bold text-center mb-8">Contact Us</h1>

            {/* ABSOLUTE FLEX TESTING CONTAINER */}
            <div className="flex flex-row items-start justify-between gap-12 max-w-5xl mx-auto border border-red-500 p-6">
                {/* Contact Form - FIXED WIDTH */}
                <div className="w-[45%] min-w-[300px] bg-blue-100 p-4 border border-blue-500">
                    <h2 className="text-xl font-bold text-center">Contact Form</h2>
                    <ContactForm />
                </div>

                {/* Founder Profile - FIXED WIDTH */}
                <div className="w-[45%] min-w-[300px] bg-green-100 p-4 border border-green-500">
                    <h2 className="text-xl font-bold text-center">Founder Profile</h2>
                    <FounderProfile />
                </div>
            </div>
        </div>
    );
}

export default Contact;
